      const decimalPlaces = (increment.toString().split('.')[1] || "").length;

      for (let i = begNum; begNum < endNum ? i <= endNum : i >= endNum; i += increment) {
          array.push(parseFloat(i.toFixed(decimalPlaces)));
      }
      return array;
    }


